CHOOSE_SPECIALIZATION = "Selecciona tu especialización";
CHOOSE_SPECIALIZATION_HELP = "Ahora tu personaje puede elegir una especialización de clase. Las especializaciones otorgan nuevas facultades en el nivel 10 y ofrecen facultades adicionales al subir de nivel. La mayoría de las especializaciones usan ataques y hechizos diferentes de los de las otras especializaciones de la misma clase.\n\nAlgunas especializaciones te permiten cumplir distintas funciones, como la de tanque o sanador. Visita a un instructor de clase para cambiar tu especialización en cualquier momento.";
CHOOSE_SPECIALIZATION_NOW = "Ahora tu personaje puede elegir una especialización de clase.";
CHOOSE_STATIONERY = "Elige artículos de papelería";
CHOOSE_TALENTS = "Selecciona tus talentos";
CHOOSE_TALENTS_HELP = "Los talentos son facultades especiales, entre las que se pueden encontrar ataques activos o hechizos que puedes colocar en tu barra de acción, y facultades pasivas.\n\nEn realidad, no existen buenas o malas elecciones para tu personaje. Debes escoger basándote en lo que consideres divertido o los complementos que más se ajusten a tu estilo de juego. Cada vez que elijas un talento, tendrás que descartar dos de tres.\n\nPara reiniciar tus talentos, visita a un instructor de clase o selecciona otros que se encuentren en la misma fila que el que quieres cambiar con un objeto denominado %s.";
CHOOSE_TALENTS_NOW = "Ahora tu personaje puede elegir talentos.";
CHOOSE_THE_ALLIANCE = "Las nobles razas de la Alianza están unidas por orgullosas tradiciones de nobleza, honor, fe, justicia y sacrificio.\n\nLos distintos pueblos de la Alianza contribuyen con su sabiduría técnica, arcana y espiritual para alcanzar un objetivo: un mundo justo y en paz.\n\nLleva su estandarte y representa los altos ideales de la Alianza por todo Azeroth y más allá.";
CHOOSE_THE_HORDE = "Las orgullosas naciones de la Horda se han unido por conveniencia contra un mundo hostil que desea destruirlas.\n\nLa Horda es decidida, feroz, y en ocasiones monstruosa. Valora la fuerza y el honor, pero le cuesta controlar su agresividad.\n\nÚnete a la Horda y lucha para construir un mundo en el que sus gentes puedan vivir en libertad.";
