RACE_INFO_BLOODELF = "Hace mucho tiempo, los majestuosos elfos nobles construyeron la espléndida ciudad dorada de Quel'Thalas alrededor de la fuente de energía mágica conocida como La Fuente del Sol. Cuando el Rey Exánime destruyó su capital en la Tercera Guerra, los supervivientes pidieron ayuda a la Horda.\n\nAhora, conocidos como los elfos de sangre, estos refugiados son lo único que queda de su gloriosa civilización. Intentan reconstruir Quel'Thalas mientras luchan contra la dolorosa adicción a la energía mágica que antaño ayudara a construir su Imperio.";
RACE_INFO_BLOODELF_FEMALE = "Hace mucho tiempo, los majestuosos elfos nobles construyeron la espléndida ciudad dorada de Quel'Thalas alrededor de la fuente de energía mágica conocida como La Fuente del Sol. Cuando el Rey Exánime destruyó su capital en la Tercera Guerra, los supervivientes pidieron ayuda a la Horda.\n\nAhora, conocidos como los elfos de sangre, estos refugiados son lo único que queda de su gloriosa civilización. Intentan reconstruir Quel'Thalas mientras luchan contra la dolorosa adicción a la energía mágica que antaño ayudara a construir su Imperio.";
RACE_INFO_BLOODELF_SHORT = "Hace mucho tiempo, los majestuosos elfos nobles construyeron la espléndida ciudad dorada de Quel'Thalas. <PH>";
RACE_INFO_DARKIRONDWARF = "Los enanos Hierro Negro, conocidos por su fuerte temperamento y su fiera determinación, tienen todo un historial de conflictos con los otros clanes enanos... y con su propia gente. La reina regente Moira intenta unir a su pueblo y liderarlo en la batalla para salvar Azeroth.";
RACE_INFO_DARKIRONDWARF_FEMALE = "Los enanos Hierro Negro, conocidos por su fuerte temperamento y su fiera determinación, tienen todo un historial de conflictos con los otros clanes enanos... y con su propia gente. La reina regente Moira intenta unir a su pueblo y liderarlo en la batalla para salvar Azeroth.";
RACE_INFO_DARKIRONDWARF_SHORT = "Los enanos Hierro Negro, conocidos por su fuerte temperamento y su fiera determinación, tienen una larga historia de conflictos. <PH>";
RACE_INFO_DRAENEI = "Lejos de su hogar, Argus, los honorables draenei huyeron de la Legión Ardiente durante eones antes de encontrar un planeta remoto donde asentarse. Compartieron ese mundo con los chamanísticos orcos y lo llamaron Draenor. Con el tiempo, la Legión corrompió a los orcos, quienes hicieron la guerra y casi exterminaron a los pacíficos draenei. Unos pocos afortunados escaparon y llegaron a Azeroth donde ahora buscan aliados en su batalla contra la Legión Ardiente.";
RACE_INFO_DRAENEI_FEMALE = "Lejos de su hogar, Argus, los honorables draenei huyeron de la Legión Ardiente durante eones antes de encontrar un planeta remoto donde asentarse. Compartieron ese mundo con los chamanísticos orcos y lo llamaron Draenor. Con el tiempo, la Legión corrompió a los orcos, quienes hicieron la guerra y casi exterminaron a los pacíficos draenei. Unos pocos afortunados escaparon y llegaron a Azeroth donde ahora buscan aliados en su batalla contra la Legión Ardiente.";
RACE_INFO_DRAENEI_SHORT = "Expulsados de su hogar, Argus, los honorables draenei huyeron de la Legión Ardiente durante eones. <PH>";
RACE_INFO_DWARF = "En el pasado, los enanos solo se preocupaban por las riquezas extraídas de las entrañas de la tierra. Fue así como hallaron vestigios de una raza divina que, según parece, les dio vida... y derecho de nacimiento encantado. Impulsados a aprender más por este descubrimiento, los enanos se consagraron a la búsqueda de artefactos perdidos y el conocimiento arcano. Hoy en día, hay arqueólogos enanos repartidos por todo el mundo.";
RACE_INFO_DWARF_FEMALE = "En el pasado, los enanos solo se preocupaban por las riquezas extraídas de las entrañas de la tierra. Fue así como hallaron vestigios de una raza divina que, según parece, les dio vida... y derecho de nacimiento encantado. Impulsados a aprender más por este descubrimiento, los enanos se consagraron a la búsqueda de artefactos perdidos y el conocimiento arcano. Hoy en día, hay arqueólogos enanos repartidos por todo el mundo.";
RACE_INFO_DWARF_SHORT = "En el pasado, los enanos solo se preocupaban por las riquezas extraídas de las entrañas de la tierra. <PH>";
RACE_INFO_GNOME = "A pesar de su baja estatura, los ingeniosos gnomos de Khaz Modan usaron su prodigioso intelecto para asegurarse un lugar en la Historia. Su reino subterráneo, Gnomeregan, es una maravilla de la tecnología a vapor, y su habilidad tanto en ingeniería como en las artes arcanas ha sido de gran ayuda para la Alianza en numerosas campañas.";
RACE_INFO_GNOME_FEMALE = "A pesar de su baja estatura, los ingeniosos gnomos de Khaz Modan usaron su prodigioso intelecto para asegurarse un lugar en la Historia. Su reino subterráneo, Gnomeregan, es una maravilla de la tecnología a vapor, y su habilidad tanto en ingeniería como en las artes arcanas ha sido de gran ayuda para la Alianza en numerosas campañas.";
RACE_INFO_GNOME_SHORT = "Los gnomos de Khaz Modan son criaturas de baja estatura pero de gran ingenio e intelecto. <PH>";
RACE_INFO_GOBLIN = "Los goblins, que originalmente fueron los esclavos de los trols de la selva en la Isla de Kezan, se vieron forzados a trabajar en las minas de kaja'mita de Minahonda, en las entrañas del Monte Kajaro. Lo que nadie sabía en aquella época era que el mineral tenía propiedades mágicas que aumentaban rápidamente el ingenio y la inteligencia de los goblins. En secreto, crearon poderosos artefactos de ingeniería y alquimia y derrocaron a los opresores trols, conquistando así la isla que ahora consideran su hogar. Rápidamente destacaron por su maestría en el mercantilismo y, con sus conglomerados de compraventa globales, ahora dominan todo el comercio a lo largo y ancho de Azeroth.";
RACE_INFO_GOBLIN_SHORT = "Los goblins, que originalmente fueron los esclavos de los trols de la selva en la Isla de Kezan, se vieron forzados a trabajar en las minas. <PH>";
RACE_INFO_HIGHMOUNTAINTAUREN = "Los tauren de Monte Alto honran a los espíritus de la tierra, los ríos y los cielos. Tras proteger su montaña sagrada durante años, ahora están listos para aventurarse más allá de las Islas Abruptas.";
RACE_INFO_HIGHMOUNTAINTAUREN_FEMALE = "Los tauren de Monte Alto honran a los espíritus de la tierra, los ríos y los cielos. Tras proteger su montaña sagrada durante años, ahora están listos para aventurarse más allá de las Islas Abruptas.";
RACE_INFO_HIGHMOUNTAINTAUREN_SHORT = "Los tauren de Monte Alto honran a los espíritus de la tierra, los ríos y los cielos. <PH>";
RACE_INFO_HUMAN = "Los humanos son una raza joven y, por lo tanto, muy versátil. Dominan las artes del combate, la artesanía y la magia con una eficacia sorprendente. Su valor y optimismo los han llevado a levantar algunos de los reinos más espléndidos del mundo. En esta turbulenta era, tras generaciones de conflictos, los humanos quieren recuperar la gloria que los distinguió otrora y forjarse un nuevo y brillante futuro.";
RACE_INFO_HUMAN_FEMALE = "Los humanos son una raza joven y, por lo tanto, muy versátil. Dominan las artes del combate, la artesanía y la magia con una eficacia sorprendente. Su valor y optimismo los han llevado a levantar algunos de los reinos más espléndidos del mundo. En esta turbulenta era, tras generaciones de conflictos, los humanos quieren recuperar la gloria que los distinguió otrora y forjarse un nuevo y brillante futuro.";
RACE_INFO_HUMAN_SHORT = "Los humanos son una raza joven, y por tanto muy versátil, que domina las artes del combate. <PH>";
RACE_INFO_KULTIRAN = "Kul Tiras es una región fundada por exploradores intrépidos que navegaron a través de aguas inexploradas en busca de aventuras. La marina de Kul Tiras dominó los mares de Azeroth gracias a su flota legendaria como miembro clave de la Alianza de Lordaeron.";
RACE_INFO_KULTIRAN_FEMALE = "Kul Tiras es una región fundada por exploradores intrépidos que navegaron a través de aguas inexploradas en busca de aventuras. La marina de Kul Tiras dominó los mares de Azeroth gracias a su flota legendaria como miembro clave de la Alianza de Lordaeron.";
RACE_INFO_KULTIRAN_SHORT = "Kul Tiras es una región fundada por exploradores intrépidos que navegaron a través de aguas inexploradas en busca de aventuras. <PH>";
RACE_INFO_LIGHTFORGEDDRAENEI = "Durante su larga y amarga guerra contra la Legión Ardiente, estos soldados draenei se entregaron a la Luz Sagrada y se convirtieron en armas vivientes. Tras alcanzar la tan esperada victoria, estos forjados por la Luz están preparados para defender Azeroth.";
RACE_INFO_LIGHTFORGEDDRAENEI_FEMALE = "Durante su larga y amarga guerra contra la Legión Ardiente, estos soldados draenei se entregaron a la Luz Sagrada y se convirtieron en armas vivientes. Tras alcanzar la tan esperada victoria, estos forjados por la Luz están preparados para defender Azeroth.";
RACE_INFO_LIGHTFORGEDDRAENEI_SHORT = "Durante su larga y amarga guerra contra la Legión Ardiente, estos soldados draenei se entregaron a la Luz Sagrada. <PH>";
RACE_INFO_MAGHARORC = "Los clanes orcos de Draenor no llegaron a beber la sangre demoníaca que corrompió a sus parientes lejanos. Orgullosos y desafiantes, se mantuvieron unidos como una sola tribu: los Mag'har. Con su implacable valor y su fiero sentido del honor, ahora los Mag'har luchan para conseguir un nuevo hogar en Azeroth.";
RACE_INFO_MAGHARORC_FEMALE = "Los clanes orcos de Draenor no llegaron a beber la sangre demoníaca que corrompió a sus parientes lejanos. Orgullosos y desafiantes, se mantuvieron unidos como una sola tribu: los Mag'har. Con su implacable valor y su fiero sentido del honor, ahora los Mag'har luchan para conseguir un nuevo hogar en Azeroth.";
RACE_INFO_MAGHARORC_SHORT = "Los clanes orcos de Draenor no llegaron a beber la sangre demoníaca que corrompió a sus parientes lejanos. <PH>";
RACE_INFO_MECHAGNOME = "Aunque en otro tiempo pretendieron mecanizarse por completo, ahora los mecagnomos buscan un equilibrio entre carne y acero. Tras años de aislamiento en Mecandria, ahora aportan ingenio y destreza a la Alianza.";
RACE_INFO_MECHAGNOME_FEMALE = "Aunque en otro tiempo pretendieron mecanizarse por completo, ahora los mecagnomos buscan un equilibrio entre carne y acero. Tras años de aislamiento en Mecandria, ahora aportan ingenio y destreza a la Alianza.";
RACE_INFO_MECHAGNOME_SHORT = "Aunque en otro tiempo pretendieron mecanizarse por completo, ahora los mecagnomos buscan un equilibrio. <PH>";
RACE_INFO_NIGHTBORNE = "Los Nocheterna de Suramar pasaron miles de años aislados tras una barrera Arcana, y la magia de la Fuente de la Noche los fue transformando poco a poco. Ahora, estos elfos nobles y orgullosos intentan recuperar su lugar en Azeroth.";
RACE_INFO_NIGHTBORNE_FEMALE = "Los Nocheterna de Suramar pasaron miles de años aislados tras una barrera Arcana, y la magia de la Fuente de la Noche los fue transformando poco a poco. Ahora, estos elfos nobles y orgullosos intentan recuperar su lugar en Azeroth.";
RACE_INFO_NIGHTBORNE_SHORT = "Los Nocheterna de Suramar pasaron milenios aislados tras una barrera Arcana, y la magia de la Fuente de la Noche los fue transformando poco a poco. <PH>";
RACE_INFO_NIGHTELF = "Hace diez mil años, los elfos de la noche fundaron un vasto Imperio, pero el uso imprudente de la magia primaria los llevó a la ruina. Consternados, se retiraron a los bosques donde se aislaron hasta el regreso de su antiguo enemigo: la Legión Ardiente. Entonces no tuvieron más opción que abandonar su reclusión y luchar por su lugar en el nuevo mundo.";
RACE_INFO_NIGHTELF_FEMALE = "Hace diez mil años, los elfos de la noche fundaron un vasto Imperio, pero el uso imprudente de la magia primaria los llevó a la ruina. Consternados, se retiraron a los bosques donde se aislaron hasta el regreso de su antiguo enemigo: la Legión Ardiente. Entonces no tuvieron más opción que abandonar su reclusión y luchar por su lugar en el nuevo mundo.";
RACE_INFO_NIGHTELF_SHORT = "Hace diez mil años, los elfos de la noche fundaron un vasto Imperio. <PH>";
RACE_INFO_ORC = "La raza de los orcos es originaria del planeta Draenor. Este pueblo pacífico, de creencias chamánicas, fue esclavizado por la Legión Ardiente y forzado a participar en la guerra contra los humanos de Azeroth. Aunque tuvieron que pasar muchos años, al final escaparon de la corrupción de los demonios y recuperaron su libertad. A día de hoy, luchan por su honor en un mundo que los odia y desprecia.";
RACE_INFO_ORC_FEMALE = "La raza de los orcos es originaria del planeta Draenor. Este pueblo pacífico, de creencias chamánicas, fue esclavizado por la Legión Ardiente y forzado a participar en la guerra contra los humanos de Azeroth. Aunque tuvieron que pasar muchos años, al final escaparon de la corrupción de los demonios y recuperaron su libertad. A día de hoy, luchan por su honor en un mundo que los odia y desprecia.";
RACE_INFO_ORC_SHORT = "La raza de los orcos es originaria del planeta Draenor. Un pueblo pacífico, de creencias chamánicas. <PH>";
RACE_INFO_SCOURGE = "Antaño esclavos descerebrados del terrible Rey Exánime, los espantosos Renegados lo han derrocado y ahora juran lealtad a la malvada Reina Alma en Pena, Sylvanas. Bajo su mando, los ejércitos de Renegados se han hecho con las ruinas de Lordaeron. Cada día es una lucha contra los vengativos humanos que los quieren erradicar, y una batalla constante contra los aliados de la Horda que desconfían de los siniestros planes de los no-muertos.";
RACE_INFO_SCOURGE_FEMALE = "Antaño esclavos descerebrados del terrible Rey Exánime, los espantosos Renegados lo han derrocado y ahora juran lealtad a la malvada Reina Alma en Pena, Sylvanas. Bajo su mando, los ejércitos de Renegados se han hecho con las ruinas de Lordaeron. Cada día es una lucha contra los vengativos humanos que los quieren erradicar, y una batalla constante contra los aliados de la Horda que desconfían de los siniestros planes de los no-muertos.";
RACE_INFO_SCOURGE_SHORT = "Antaño esclavos descerebrados del terrible Rey Exánime, los espantosos Renegados consiguieron derrocarlo. <PH>";
RACE_INFO_TAUREN = "Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Madre Tierra. Muchas de las tribus nómadas tauren se han unido bajo un único estandarte y se han asentado en las fértiles llanuras de Mulgore. De no haber sido por la intervención oportuna de los orcos, los centauros merodeadores habrían aniquilado a toda la raza. Los tauren hacen honor a esta deuda de sangre luchando junto a la Horda para proteger su tierra.";
RACE_INFO_TAUREN_FEMALE = "Los tauren se esfuerzan continuamente para preservar el equilibrio de la Naturaleza y respetar los deseos de la diosa que veneran, la Madre Tierra. Muchas de las tribus nómadas tauren se han unido bajo un único estandarte y se han asentado en las fértiles llanuras de Mulgore. De no haber sido por la intervención oportuna de los orcos, los centauros merodeadores habrían aniquilado a toda la raza. Los tauren hacen honor a esta deuda de sangre luchando junto a la Horda para proteger su tierra.";
RACE_INFO_TAUREN_SHORT = "Los tauren siempre se han esforzado por preservar el equilibrio de la naturaleza y respetar los mandatos de su diosa. <PH>";
RACE_INFO_TROLL = "Los fieros trols de la tribu Lanza Negra habitaban las junglas de la Vega de Tuercespina hasta que facciones guerreras los asediaron por todos los flancos. La Horda de los orcos acudió en su ayuda y convenció a los Lanza Negra de que cruzaran el Mare Magnum y se establecieran en las tierras salvajes de Kalimdor. Aunque se aferran a su herencia oscura, los Lanza Negra siguen abogando por una Horda unida, y contribuyen con la fuerza de sus armas y su poderosa magia tribal a la causa común.";
RACE_INFO_TROLL_FEMALE = "Los fieros trols de la tribu Lanza Negra habitaban las junglas de la Vega de Tuercespina hasta que facciones guerreras los asediaron por todos los flancos. La Horda de los orcos acudió en su ayuda y convenció a los Lanza Negra de que cruzaran el Mare Magnum y se establecieran en las tierras salvajes de Kalimdor. Aunque se aferran a su herencia oscura, los Lanza Negra siguen abogando por una Horda unida, y contribuyen con la fuerza de sus armas y su poderosa magia tribal a la causa común.";
RACE_INFO_TROLL_SHORT = "Los fieros trols de la tribu Lanza Negra habitaban las selvas de la Vega de Tuercespina. <PH>";
RACE_INFO_VOIDELF = "Estos elfos desterrados sufrieron una transformación inesperada al tratar de dominar la magia corruptora del Vacío. Ahora están decididos a dominar sus nuevos poderes y a resistirse a los susurros que intentan arrastrarlos a la locura.";
RACE_INFO_VOIDELF_FEMALE = "Estos elfos desterrados sufrieron una transformación inesperada al tratar de dominar la magia corruptora del Vacío. Ahora están decididos a dominar sus nuevos poderes y a resistirse a los susurros que intentan arrastrarlos a la locura.";
RACE_INFO_VOIDELF_SHORT = "Estos elfos desterrados sufrieron una transformación inesperada al tratar de dominar la magia corruptora del Vacío. <PH>";
RACE_INFO_VULPERA = "Astutos y con recursos, los vulperas de Vol'dun han sobrevivido en las arenas durante generaciones. Impacientes por unirse a las filas de la Horda, sus caravanas han abandonado ya las dunas en busca de aventuras.";
RACE_INFO_VULPERA_FEMALE = "Astutos y con recursos, los vulperas de Vol'dun han sobrevivido en las arenas durante generaciones. Impacientes por unirse a las filas de la Horda, sus caravanas han abandonado ya las dunas en busca de aventuras.";
RACE_INFO_VULPERA_SHORT = "Astutos y con recursos, los vulperas de Vol'dun han sobrevivido en las arenas durante generaciones. <PH>";
RACE_INFO_WORGEN = "Los huargen fueron liberados por el archimago Arugal en los Reinos del Este durante la Tercera Guerra. En un primer momento fueron un arma contra la Plaga, pero las bestias no tardaron en demostrar que suponían una carga demasiado pesada para los humanos de Lordaeron. Una misteriosa maldición comenzó a extenderse entre los que lucharon al lado de los hombres lobo: los convertía en huargen. La maldición se extendió rápidamente hasta alcanzar Gilneas y encerró a sus habitantes tras las murallas tan bien construidas para protegerlos. Los supervivientes de la maldición ahora buscan un nuevo destino para su pueblo, un destino no escrito...";
RACE_INFO_WORGEN_SHORT = "Los huargen fueron liberados por el archimago Arugal en los Reinos del Este. <PH>";
RACE_INFO_ZANDALARITROLL = "Los Zandalari son un pueblo orgulloso cuyas raíces llegan hasta los primeros días de la historia de Azeroth. Sus fieros guerreros montan poderosos dinosaurios en la batalla y poseen una de las flotas más formidables del mundo conocido.";
RACE_INFO_ZANDALARITROLL_FEMALE = "Los Zandalari son un pueblo orgulloso cuyas raíces llegan hasta los primeros días de la historia de Azeroth. Sus fieros guerreros montan poderosos dinosaurios en la batalla y poseen una de las flotas más formidables del mundo conocido.";
RACE_INFO_ZANDALARITROLL_SHORT = "Los Zandalari son un pueblo orgulloso cuyas raíces llegan hasta los primeros días de la historia de Azeroth. <PH>";
