TUTORIAL56 = "En la esquina superior izquierda de la pantalla aparece tu barra de salud en verde. Cuando esta barra llegue a cero, morirás, así que ten cuidado.|n|nBajo tu barra de salud hay una segunda barra que representa el recurso que utiliza tu clase para sus facultades especiales, como la ira, la energía o el maná.";
TUTORIAL57_HUMAN = "Recuerda visitar a |cffffd200alguacil McBride|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre él cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
TUTORIAL57_ORC = "Recuerda visitar a |cffffd200Gornek|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre él cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
TUTORIAL57_SCOURGE = "Recuerda visitar al |cffffd200enterrador Mordo|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre él cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
TUTORIAL57_TAUREN = "Recuerda visitar a |cffffd200Grull Viento de Halcón|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre él cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
TUTORIAL57_TROLL_DRUID = "Recuerda visitar a |cffffd200Zen'Tabra|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre ella cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
TUTORIAL57_TROLL_HUNTER = "Recuerda visitar a |cffffd200Ortezza|r. ¡Tiene una misión para ti! |cffffd200Haz clic derecho|r sobre ella cuando tu cursor aparezca como un |cffffd200signo de interrogación amarillo|r.";
