TUTORIAL6 = "Muchas de tus facultades son ataques con armas o hechizos de combate.|n|nDependiendo de tu clase, puede que tengas en tu barra de acción facultades defensivas o incluso hechizos de sanación.";
TUTORIAL60 = "Recuerda, tu personaje tiene facultades especiales en la barra de acción en la parte inferior de la pantalla.|n|nSi usas estas facultades podrás matar a los enemigos mucho más rápidamente que si te limitas a golpearlos con tu arma.";
TUTORIAL61_DRUID = "Como druida, puedes |cffffd200cambiar tu forma|r a varias formas, cada una con facultades únicas y su propio recurso. Tu primera forma, la felina, aumenta tu daño cuerpo a cuerpo.";
TUTORIAL61_HUNTER = "Ahora tienes una |cffffd200barra de acción de mascota|r para controlar mejor a tu mascota. Además tienes la facultad para |cffffd200domesticar bestias|r y así conseguir nuevas mascotas.";
TUTORIAL61_PALADIN = "Ahora puedes usar |cffffd200Poder Sagrado|r. Tu Golpe de cruzado genera poder sagrado y tu Palabra de gloria puede gastarlo.";
TUTORIAL61_SHAMAN = "Has aprendido tu primer |cffffd200tótem|r. Cada tótem proporciona un tipo diferente de beneficio. Al final, podrás usar los cuatro tótems al mismo tiempo.";
