TUTORIAL7 = "Si derrotas a un enemigo y ves que su cuerpo brilla, quiere decir que tiene botín.|n|nHaz |cffffd200clic derecho|r en el cadáver de una criatura para despojarlo. Esto abrirá la ventana de botín. Después haz |cffffd200clic derecho|r en cualquier objeto de esa ventana para guardarlo en tu mochila.";
TUTORIAL8 = "Has guardado un objeto en tu mochila.|n|nPara abrirla, haz clic sobre el |cffffd200botón de la mochila|r, en la parte inferior derecha de la pantalla. Mueve el ratón sobre el objeto para ver lo que es.";
TUTORIAL9 = "Algunos objetos se pueden utilizar. Haz |cffffd200clic derecho|r sobre un objeto para usarlo.|n|nPuedes arrastrar los objetos a la barra de acción para poder usarlos sin necesidad de abrir tu mochila.";
TUTORIAL_DRACTHYR_EMPOWERED_HOLD = "Cuanto más tiempo pasas lanzando un hechizo potenciado, más poderoso se vuelve.\n\n|cFF00FFFFMantén pulsada|r la tecla del hechizo para empezar el lanzamiento y |cFF00FFFFsuéltala|r para lanzarlo.";
TUTORIAL_DRACTHYR_EMPOWERED_TAP = "Cuanto más tiempo pasas lanzando un hechizo potenciado, más poderoso se vuelve.\n\n|cFF00FFFFPulsa|r la tecla del hechizo para empezar el lanzamiento y |cFF00FFFFvuelve a pulsarla|r para lanzarlo.";
TUTORIAL_DRACTHYR_ESSENCE = "La |cFF00FFFFesencia|r es un recurso que se usa con hechizos como |cFF00FFFFDesintegrar|r.\n\nSe recupera de forma natural con el paso del tiempo.";
TUTORIAL_DRACTHYR_SELF_CAST = "Hold |cFF00FFFF%s|r and cast |cFF00FFFFLiving Flame|r to heal yourself";
